#
# View "sitemanage"
#

DROP VIEW IF EXISTS `sitemanage`;
CREATE
  ALGORITHM = UNDEFINED
  VIEW `sitemanage`
  AS
SELECT
  `site`.`site_id`,
  `site`.`site_name`,
  `site`.`stype`,
  `site`.`state`,
  `wuser`.`user_name`,
  `water`.`water_name`,
  `province`.`province_name`,
  `warea`.`area_name`
FROM
  ((((`site`
    JOIN `wuser`)
    JOIN `water`)
    JOIN `warea`)
    JOIN `province`)
WHERE
  ((`site`.`uid` = `wuser`.`user_id`)
    AND (`site`.`wid` = `water`.`water_id`)
    AND (`site`.`aid` = `warea`.`area_id`)
    AND (`warea`.`pid` = `province`.`province_id`)
    AND (`site`.`del` <> 1));
